<p>
1973 ഡിസംബർ 9നു മാഡിസണിൽ റോബർട്ട് കരോലിൻ അബ്രാംസ് ദമ്പതികളുടെ ആറ്മക്കളിൽ ഒരാളായിട്ടാണ്‌ സ്‌റ്റേസിയുടെ ജനനം. <br/>
在1973年12月9日麦迪逊罗伯特·卡罗琳亚伯兰出生于夫妇的之一。 <br/>
